plantuml_diagram:
@startuml
!define AWSPuml https://raw.githubusercontent.com/awslabs/aws-icons-for-plantuml/v20.0/dist
!include AWSPuml/AWSCommon.puml

node "AWS Elastic Beanstalk\n(Python, Dash, Flask)" as beanstalk {
  node "Web Application\n(Dash/Flask)" as webapp
}

cloud "AWS S3" as s3

webapp --> s3 : Reads/Writes Data

actor "User" as user
user --> webapp : HTTP/HTTPS Requests

@enduml
